import React from 'react'
import styled from "styled-components";

const Draw = (props) => {

    return(
        <DrawStyle onClick={props.makePick} id={props.team}>
            {props.score}
        </DrawStyle>
    )
}

const DrawStyle = styled.div`
    width: 320px;
    background-color: #ADD8E6;
    padding: 5px 0;
    position: relative;
    left: 12.5%;
`

export default Draw;
